body:
i have a folder with lots of mp3 music files. this folder is called "musik" and resides in my owncloud user-root directory. after a while this folder is displayed twice (so, i see two folders, both named "musik". after another while, a third folder apears etc...

every subfolder or file in the musik folder is also displayed multiple times (so when i enter the musik folder, i see as many multiple subfolders as i see the musik folder).

this only happens to the musik folder (and it subfolders), but not to any other folders. however, this is the folder with the most files in it and usually scanning the music library in the music app does not succeed.

i suspect that during the scan of the (big) musik folder, the scan process dies and restarts again from the beginning resulting in mulitple entries of the same folder in the database.

### expected behaviour
all folders should only be listed once on the web interface

### actual behaviour
musik folder listed multiple times

### server configuration
operating system: debian 4.3.2-1.1

web server: apache

database: mysql

php version: 5.3.13

owncloud version: 5.0.11 (the problem occures since 5.0.8)

### client configuration
browser: firefox

operating system: ubuntu 12.10

